(306, 31, '妇产科', '妇产科是临床医学四大主要学科之一，主要研究女性生殖器官疾病的病因、病理、诊断及防治，妊娠、分娩的生理和病理变化，高危妊娠及难产的预防和诊治，女性生殖内分分泌，计划生育及妇女保健等。', '010-88888631'),
(307, 31, '儿科', '儿科是全面研究小儿时期身心发育、保健以及疾病防治的综合医学科学。', '010-88888731'),
(308, 31, '放射科', '放射科是医院重要的辅助检查科室，在现代医院建设中，放射科是一个集检查、诊断、治疗一体科室，临床各科许多疾病都须通过放射科设备检查达到明确诊断和辅助诊断。', '010-88888831'),
(309, 31, '牙科', '牙科，医学学科分类之一，在大医院一般并入口腔科。牙科主要治疗牙齿、牙周相关的疾病。', '010-88888931'),
(310, 31, '皮肤科', '皮肤科是治疗皮肤疾病的医学分支。也指综合性医院当中诊疗皮肤疾病的科室。在广义上，皮肤科还包含对头发、指（趾）甲疾病的治疗。', '010-88888031'),
(311, 32, '眼科', '眼科的全称是“眼病专科”。眼科是研究发生在视觉系统，包括眼球及与其相关联的组织有关疾病的学科。', '010-88888132'),
(312, 32, '耳鼻喉科', '“耳鼻咽喉科”是诊断治疗耳、鼻、咽喉、及其相关头颈区域的外科学科。', '010-88888232'),
(313, 32, '外科', '外科是研究外科疾病的发生，发展规律及其临床表现，诊断，预防和治疗的科学，是以手术切除、修补为主要治病手段的专业科室。', '010-88888332'),
