INSERT INTO `doctor` (`id`, `department_id`, `name`, `photo`, `info`, `title`, `price`) VALUES
(1, 1, '王托地', '王托地1.jpg', '王托地,医学博士,理学副教授,药学副教授。中国人民解放军总医院301医院眼科特级专家。1979年东京大学获眼科硕士学位,1984年伦敦皇家医学院获眼科博士学位,1987年牛津大学获眼科Ph.D<br>从事眼科工作已经15年。有丰富的医学、药理学知识与经验。发表文章12余篇。现任《中国医科大学学报》主编,《中国实用医学杂志》编纂委员会主任。<br>', '特级专家', '4.43'),
(2, 1, '韩夸至', '韩夸至2.jpg', '韩夸至,医学教授,理学副教授,药学硕士。中国人民解放军总医院301医院眼科医师。1960年东京大学获眼科硕士学位,1964年东京大学获眼科博士学位,1972年伦敦皇家医学院获眼科Ph.D<br>从事眼科工作已经19年。有丰富的医学、药理学知识与经验。发表文章26余篇。现任《中华临床营养杂志》指导委员会常委,《中国实用医学杂志》主编。<br>', '医师', '16.88'),
(3, 1, '孙扩', '孙扩3.jpg', '孙扩,医学硕士,理学副教授,药学教授。中国人民解放军总医院301医院眼科医师。1960年牛津大学获眼科硕士学位,1965年九州大学获眼科博士学位,1971年中国医科大学获眼科Ph.D<br>从事眼科工作已经19年。有丰富的医学、药理学知识与经验。发表文章11余篇。现任《中华临床营养杂志》指导委员会常委,《中国实用医学杂志》主编。<br>', '医师', '2.93'),
(4, 1, '郑巩压', '郑巩压4.jpg', '郑巩压,医学博士,理学教授,药学教授。中国人民解放军总医院301医院眼科特级专家。1972年牛津大学获眼科硕士学位,1979年浙江大学获眼科博士学位,1984年中国医科大学获眼科Ph.D<br>从事眼科工作已经5年。有丰富的医学、药理学知识与经验。发表文章25余篇。现任《中国医科大学学报》协会成员,《中国实用医学杂志》编纂委员会主任。<br>', '特级专家', '5.04'),
(5, 1, '施芒至', '施芒至5.jpg', '施芒至,医学博士,理学副教授,药学硕士。中国人民解放军总医院301医院眼科海外专家。1972年九州大学获眼科硕士学位,1975年北京大学获眼科博士学位,1982年牛津大学获眼科Ph.D<br>从事眼科工作已经15年。有丰富的医学、药理学知识与经验。发表文章12余篇。现任《中华临床营养杂志》指导委员会常委,《中国医学年鉴》编纂委员会主任。<br>', '海外专家', '9.78'),
