(1285, 257, '赵当光', '赵当光1285.jpg', '赵当光,医学副教授,理学硕士,药学硕士。中国人民解放军第二七二医院儿科海外专家。1961年九州大学获儿科硕士学位,1964年伦敦皇家医学院获儿科博士学位,1971年牛津大学获儿科Ph.D<br>从事儿科工作已经9年。有丰富的医学、药理学知识与经验。发表文章24余篇。现任《中国医科大学学报》指导委员会常委,《中国实用医学杂志》协会成员。<br>', '海外专家', '12.22'),
(1286, 258, '沈列', '沈列1286.jpg', '沈列,医学博士,理学副教授,药学硕士。中国人民解放军第二七二医院放射科医师。1978年清华大学获放射科硕士学位,1981年牛津大学获放射科博士学位,1988年牛津大学获放射科Ph.D<br>从事放射科工作已经13年。有丰富的医学、药理学知识与经验。发表文章38余篇。现任《中华临床营养杂志》编纂委员会主任,《中国实用医学杂志》协会成员。<br>', '医师', '2.03'),
