(2371, 475, '周协西', '周协西2371.jpg', '周协西,医学博士,理学博士,药学教授。吉林大学中日联谊医院内科特级专家。1961年伦敦皇家医学院获内科硕士学位,1969年东京大学获内科博士学位,1974年东京大学获内科Ph.D<br>从事内科工作已经11年。有丰富的医学、药理学知识与经验。发表文章37余篇。现任《中华临床营养杂志》协会成员,《中国实用医学杂志》编纂委员会主任。<br>', '特级专家', '8.56'),
