(2398, 480, '冯夹共', '冯夹共2398.jpg', '冯夹共,医学博士,理学硕士,药学副教授。吉林大学中日联谊医院皮肤科专家。1963年伦敦皇家医学院获皮肤科硕士学位,1971年九州大学获皮肤科博士学位,1975年中国医科大学获皮肤科Ph.D<br>从事皮肤科工作已经7年。有丰富的医学、药理学知识与经验。发表文章10余篇。现任《中国医科大学学报》协会成员,《中国实用医学杂志》主编。<br>', '专家', '7.40'),
