(2486, 498, '何夹', '何夹2486.jpg', '何夹,医学硕士,理学教授,药学硕士。吉林大学第四医院放射科专家。1978年浙江大学获放射科硕士学位,1983年清华大学获放射科博士学位,1986年伦敦皇家医学院获放射科Ph.D<br>从事放射科工作已经11年。有丰富的医学、药理学知识与经验。发表文章28余篇。现任《中国医科大学学报》指导委员会常委,《中国实用医学杂志》编纂委员会主任。<br>', '专家', '16.58'),
(2487, 498, '杨轨西', '杨轨西2487.jpg', '杨轨西,医学副教授,理学博士,药学博士。吉林大学第四医院放射科实习医生。1975年北京大学获放射科硕士学位,1983年九州大学获放射科博士学位,1988年清华大学获放射科Ph.D<br>从事放射科工作已经17年。有丰富的医学、药理学知识与经验。发表文章25余篇。现任《中华临床营养杂志》协会成员,《中国实用医学杂志》编纂委员会主任。<br>', '实习医生', '12.91'),
(2488, 498, '吕因邪', '吕因邪2488.jpg', '吕因邪,医学副教授,理学博士,药学教授。吉林大学第四医院放射科实习医生。1965年东京大学获放射科硕士学位,1970年中国医科大学获放射科博士学位,1978年东京大学获放射科Ph.D<br>从事放射科工作已经7年。有丰富的医学、药理学知识与经验。发表文章30余篇。现任《中国医科大学学报》主编,《中国医学年鉴》协会成员。<br>', '实习医生', '11.39'),
