(2490, 498, '韩老寺', '韩老寺2490.jpg', '韩老寺,医学教授,理学教授,药学教授。吉林大学第四医院放射科医师。1962年牛津大学获放射科硕士学位,1967年牛津大学获放射科博士学位,1971年中国医科大学获放射科Ph.D<br>从事放射科工作已经14年。有丰富的医学、药理学知识与经验。发表文章15余篇。现任《中华临床营养杂志》编纂委员会主任,《中国医学年鉴》指导委员会常委。<br>', '医师', '10.70'),
(2491, 499, '郑有西', '郑有西2491.jpg', '郑有西,医学副教授,理学副教授,药学博士。吉林大学第四医院牙科专家。1976年牛津大学获牙科硕士学位,1981年中国医科大学获牙科博士学位,1984年浙江大学获牙科Ph.D<br>从事牙科工作已经6年。有丰富的医学、药理学知识与经验。发表文章14余篇。现任《中国医科大学学报》协会成员,《中国医学年鉴》协会成员。<br>', '专家', '1.43'),
(2492, 499, '蒋扩执', '蒋扩执2492.jpg', '蒋扩执,医学硕士,理学硕士,药学教授。吉林大学第四医院牙科专家。1961年清华大学获牙科硕士学位,1967年浙江大学获牙科博士学位,1974年牛津大学获牙科Ph.D<br>从事牙科工作已经11年。有丰富的医学、药理学知识与经验。发表文章19余篇。现任《自然杂志》编纂委员会主任,《中国医学年鉴》协会成员。<br>', '专家', '5.09'),
(2493, 499, '李机', '李机2493.jpg', '李机,医学副教授,理学副教授,药学博士。吉林大学第四医院牙科专家。1977年牛津大学获牙科硕士学位,1984年浙江大学获牙科博士学位,1990年牛津大学获牙科Ph.D<br>从事牙科工作已经14年。有丰富的医学、药理学知识与经验。发表文章10余篇。现任《自然杂志》编纂委员会主任,《中国实用医学杂志》编纂委员会主任。<br>', '专家', '9.31'),
(2494, 499, '周吸死', '周吸死2494.jpg', '周吸死,医学教授,理学教授,药学博士。吉林大学第四医院牙科专家。1961年北京大学获牙科硕士学位,1969年东京大学获牙科博士学位,1973年浙江大学获牙科Ph.D<br>从事牙科工作已经15年。有丰富的医学、药理学知识与经验。发表文章38余篇。现任《自然杂志》主编,《中国医学年鉴》指导委员会常委。<br>', '专家', '5.75'),
